import React from "react";
import $ from "jquery";
import {useSelector} from "react-redux";

const StatusDetector = () => {
    const status = useSelector(state => state.status)

    return (
        <React.Fragment>
            <span className={status}><p>paria</p></span>
        </React.Fragment>
    );
}


export default StatusDetector;
